  false,\n\t\"url\": null,\n\t\"notes\": \"Data.AustinTexas.gov is the official portal
  for open data from the City of Austin (COA). The City of Austinu2019s GIS/Map Downloads
  page is the official portal for COA GIS data and map products that do not reside
  on Data.AustinTexas.gov. Both are public domain websites, which means you may link
  to Data.AustinTexas.gov and ftp://ftp.ci.austin.tx.us/GIS-Data/Regional/coa_gis.html
  at no cost.  When you link to Data.AustinTexas.gov or ftp://ftp.ci.austin.tx.us/GIS-Data/Regional/coa_gis.html,
  please do it in an appropriate context as a servicernto people when they need to
  find official City of Austin data. We encourage you to use our logo,rnwhich weu2019ve
  provided below. Placement of the Data.AustinTexas.gov logo is to be used only as
  a marker and link to the home page.  It is not meant as a form of endorsement or
  approval from the City of Austin.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
